#
# TABLE STRUCTURE FOR: PAIEMENT
#

DROP TABLE IF EXISTS `PAIEMENT`;

CREATE TABLE `PAIEMENT` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `qte` int(11) NOT NULL,
  `total` float NOT NULL,
  `id_user` int(11) NOT NULL,
  `id_reservation` int(11) NOT NULL,
  `id_produit` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `id_user` (`id_user`),
  KEY `id_produit` (`id_produit`),
  KEY `id_reservation` (`id_reservation`),
  CONSTRAINT `PAIEMENT_ibfk_1` FOREIGN KEY (`id_user`) REFERENCES `USERS` (`id`),
  CONSTRAINT `PAIEMENT_ibfk_2` FOREIGN KEY (`id_produit`) REFERENCES `PRODUITS` (`id`),
  CONSTRAINT `PAIEMENT_ibfk_3` FOREIGN KEY (`id_reservation`) REFERENCES `RESERVATION` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=501 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: PARTICIPANTS
#

DROP TABLE IF EXISTS `PARTICIPANTS`;

CREATE TABLE `PARTICIPANTS` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `covid_positive` tinyint(1) NOT NULL,
  `id_user` int(11) NOT NULL,
  `id_reservation` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `id_user` (`id_user`),
  KEY `id_reservation` (`id_reservation`),
  CONSTRAINT `PARTICIPANTS_ibfk_1` FOREIGN KEY (`id_user`) REFERENCES `USERS` (`id`),
  CONSTRAINT `PARTICIPANTS_ibfk_2` FOREIGN KEY (`id_reservation`) REFERENCES `RESERVATION` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1001 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: PRODUITS
#

DROP TABLE IF EXISTS `PRODUITS`;

CREATE TABLE `PRODUITS` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `nom_produit` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `description` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `qte_dispo` int(11) NOT NULL,
  `prix` float NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=51 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: RESERVATION
#

DROP TABLE IF EXISTS `RESERVATION`;

CREATE TABLE `RESERVATION` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `date_resa` date NOT NULL,
  `is_paid` tinyint(1) NOT NULL,
  `id_user` int(11) NOT NULL,
  `id_salle` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `id_salle` (`id_salle`),
  KEY `id_user` (`id_user`),
  CONSTRAINT `RESERVATION_ibfk_1` FOREIGN KEY (`id_salle`) REFERENCES `SALLES` (`id`),
  CONSTRAINT `RESERVATION_ibfk_2` FOREIGN KEY (`id_user`) REFERENCES `USERS` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=201 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: SALLES
#

DROP TABLE IF EXISTS `SALLES`;

CREATE TABLE `SALLES` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `nom` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `description` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `capacite` int(11) NOT NULL,
  `prix` float NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=31 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: TICKETS
#

DROP TABLE IF EXISTS `TICKETS`;

CREATE TABLE `TICKETS` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `date_ticket` date NOT NULL,
  `description` text COLLATE utf8mb4_unicode_ci NOT NULL,
  `id_user` int(11) NOT NULL,
  `id_salle` int(11) DEFAULT NULL,
  `id_produit` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `id_salle` (`id_salle`),
  KEY `id_produit` (`id_produit`),
  KEY `id_user` (`id_user`),
  CONSTRAINT `TICKETS_ibfk_1` FOREIGN KEY (`id_salle`) REFERENCES `SALLES` (`id`),
  CONSTRAINT `TICKETS_ibfk_2` FOREIGN KEY (`id_produit`) REFERENCES `PRODUITS` (`id`),
  CONSTRAINT `TICKETS_ibfk_3` FOREIGN KEY (`id_user`) REFERENCES `USERS` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: USERS
#

DROP TABLE IF EXISTS `USERS`;

CREATE TABLE `USERS` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `nom` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `prenom` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `email` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `tel` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `password` text COLLATE utf8mb4_unicode_ci NOT NULL,
  `ddn` date NOT NULL,
  `adresse` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=501 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



